import React, { useEffect  } from 'react';



export const DisplayDog = ({getDogFromUrl, dog}) => {

    useEffect(() => {
        dog = getDogFromUrl();
    },[]);

    return(
        <div className="dogImage">
            <h3>Random Dog</h3>
            <p>
                {dog.fileSizeBytes}
            </p>
            <img src="`${this.dog.url}`" alt="Random Dog"/>
        </div>
    );
}

export default DisplayDog
